import { Header } from './Components/Header';
import { CardList } from './Components/CardList';
import { Buttons } from './Components/Buttons';
import './App.css';

function App() {
  return (
    <div className='App'>
      <Header />
      <CardList />
      <Buttons />
    </div>
  );
}

export default App;
